Context: Transform all the vowels to uppercase
Response: def transform_vowels(input_string):
    output_string = ''
    vowels = ['a', 'e', 'i', 'o', 'u']
    for char in input_string:
        if char in vowels:
           output_string += char.upper()
        else:
           output_string += char
    return output_string

