Answer: Context: int array[] = {8, 3, 5, 9, 3, 1, 5};
Response: int findMax(int array[])
{
    int max = array[0];
    for (int i = 1; i < sizeof(array)/sizeof(array[0]); i++)
    {
        if (array[i] > max)
            max = array[i];
    }
    return max;
}
